app.post('/register', function (req, res){

var uuid = Math.random().toString(36).replace(/[^a-z]+/g, '').substr(0, 11);
console.log(req.body);

res.send([{
            uuid: uuid,
            userName: req.body.firstName + ' ' + req.body.lastName,
            schoolId: 123456,
            profileImgURL: null,
            userStatus: 1
        }]);
});

